import Formulario from "./componentes/formulario.jsx";
import Boton from "./componentes/boton";
import Agregados from "./componentes/agregados";
import {useState} from 'react';
//import React from "react";

function App() {
  const [pass] = useState('252525');
  const [valPass, setValpass] = useState(false);

  return (
    <body>
      <div className="container">
        <form>
          <Formulario password={pass} setValpass={setValpass} />

          {valPass ? <Boton /> : null}
        </form>
        <div className="drops">
          <Agregados />
        </div>
      </div>
    </body>
  );
}

export default App;
